INSERT INTO `products` (`id`, `title`, `foto`, `deskripsi`, `createdAt`, `updatedAt`) VALUES
(71, 'Kacang Polong ', 'data:image/jpeg;base64,', 'Kacang polong adalah satu dari sekian banyak jenis kacang-kacangan dengan bentuk fisik bulat, berukuran kecil, dan berwarna hijau khas. Kacang polong termasuk dalam keluarga legum,  kacang polong tumbuh dalam pH air 6.0 - 7.5', '2022-03-31', '2022-03-31');
INSERT INTO `products` (`id`, `title`, `foto`, `deskripsi`, `createdAt`, `updatedAt`) VALUES
(72, 'Okra', 'data:image/jpeg;base64,', 'Okra sendiri merupakan salah satu jenis sayuran yang memiliki banyak serat dan glutation. Tak hanya itu, okra juga mengandung vitamin, mineral, dan protein yang baik untuk kesehatan tubuh. kacang polong tumbuh dalam pH air 6.5', '2022-03-31', '2022-03-31');
INSERT INTO `products` (`id`, `title`, `foto`, `deskripsi`, `createdAt`, `updatedAt`) VALUES
(73, 'Tomat', 'data:image/jpeg;base64,', 'tomat adalah buah karena berisi biji dan berkembang dari tanaman berbunga.Tomat juga bisa disebut sayur, dengan kandungan karbohidrat dan gulanya yang rendah. Tomat tumbuh dalam pH air 6.0 - 6.5', '2022-03-31', '2022-03-31');
INSERT INTO `products` (`id`, `title`, `foto`, `deskripsi`, `createdAt`, `updatedAt`) VALUES
(74, 'Terong', 'data:image/jpeg;base64,', 'Terong merupakan salah satu sayuran yang cukup populer di kalangan masyarakat Indonesia. Terong sering dijadikan sebagai bahan utama dalam berbagai jenis olahan, seperti digoreng atau dijadikan sambal. Terong tumbuh dalam pH air 6.0', '2022-03-31', '2022-03-31');
INSERT INTO `products` (`id`, `title`, `foto`, `deskripsi`, `createdAt`, `updatedAt`) VALUES
(76, 'Timun Jepang', 'data:image/jpeg;base64,', 'Timun jepang memiliki rasa tawar, namun hadir dengan tekstur yang lebih padat dan berair dibandingkan dengan timun lokal.  Selain itu, timun jepang memiliki daging yang transparan dan cenderung agak berbiji.  timun jepang tumbuh dalam pH air 6.0', '2022-03-31', '2022-03-31');
